import React from 'react';
import TableTr from './TableTr';

const Table = (props) => {
    return (
        <table className="result">
            <thead>
                <tr>
                    <th>Year</th>
                    <th>Total Savings</th>
                    <th>Interest (Year)</th>
                    <th>Total Interest</th>
                    <th>Invested Capital</th>
                </tr>
            </thead>
            <tbody>
                {props.yearlyData?.length <= 0 && <p>No Data Found...</p>}
                {props.yearlyData?.map(item => {
                    return (
                        <TableTr yearsNumber={item.yearsNumber} totalSaving={item.totalSaving} interestGained={item.interestGained} totalInterestGained={item.totalInterestGained} totalInvested={item.totalInvested} />
                    )
                })}
            </tbody>
        </table>
    )
}
export default Table;
